import React from 'react';
import { TypeAnimation } from 'react-type-animation';




const Project = () => {

  return (
    <div className='about'>
      <div className='banner-text'>
        <TypeAnimation
          cursor={false}
          sequence={[
            'Some of My Projects',
            2000,

          ]}
          wrapper="h2"
          repeat={Infinity}
          style={{ fontSize: '3em', color: 'rgb(34, 32, 32)', letterSpacing: '-2px', fontFamily: 'Rubik Maze', fontWeight: 'lighter' }}
        />
        <hr />
      </div>

      <div class="ui grid"><div class="three column row"><div class="column"><img src="https://react.semantic-ui.com/images/wireframe/image.png" class="ui image"/></div><div class="column"><img src="https://react.semantic-ui.com/images/wireframe/image.png" class="ui image"/></div><div class="column"><img src="https://react.semantic-ui.com/images/wireframe/image.png" class="ui image"/></div></div><div class="four column row"><div class="column"><img src="https://react.semantic-ui.com/images/wireframe/image.png" class="ui image"/></div><div class="column"><img src="https://react.semantic-ui.com/images/wireframe/image.png" class="ui image"/></div><div class="column"><img src="https://react.semantic-ui.com/images/wireframe/image.png" class="ui image"/></div><div class="column"><img src="https://react.semantic-ui.com/images/wireframe/image.png" class="ui image"/></div></div><div class="five column row"><div class="column"><img src="https://react.semantic-ui.com/images/wireframe/image.png" class="ui image"/></div><div class="column"><img src="https://react.semantic-ui.com/images/wireframe/image.png" class="ui image"/></div><div class="column"><img src="https://react.semantic-ui.com/images/wireframe/image.png" class="ui image"/></div><div class="column"><img src="https://react.semantic-ui.com/images/wireframe/image.png" class="ui image"/></div><div class="column"><img src="https://react.semantic-ui.com/images/wireframe/image.png" class="ui image"/></div></div></div>
    </div>
  )
}

export default Project;
